import { BrowserRouter, Router, Switch } from "react-router-dom";
import Login from "./component/Login";

function App() {
  return (
    <BrowserRouter>
      <Switch><Router></Router></Switch>
      <Login/>
    </BrowserRouter>
  );
}

export default App;
